R["oh__@dracenfer"]="{['Version']=1762,['na']={[64]={['N']='Vakka-Ku-Xul',['O']=18578,},[2]={['N']='Chapel of Akatosh',['O']=18411,},[68]={['N']='The Mad Cat\\'s Den',['O']=18411,},[5]={['N']='Melody and Harmony',['O']=18731,},[6]={['N']='The Walking Ways',['O']=18484,},[73]={['N']='The Half Moon Parlor',['O']=18876,['C']=1.024000,['D']='This location offers food and games to large and small parties. While the business fronts as legitimate, high stakes gambling hosted by various Thieves\\' Guild patrons is known to occur in back rooms to those who receive invitations. An unassuming khajiit lives in the single apartment connected, few know what her ties are to the nefarious owners of this business... but those who do know not to cross her.',},[74]={['N']='Cathedral of Seht',['O']=18411,},[43]={['N']='Tel Revas',['O']=18778,['C']=1.021000,},[12]={['N']='Morag Ruhn',['O']=18452,},[45]={['N']='Tel Sanguerre',['O']=18848,['C']=1.026000,['D']='Residence of a formidable Telvanni Magister exiled for joining the Pact and outlawing slavery. Inside are artworks depicting recent triumphs of Vivec and Sotha Sil over their daedric adversaries.',},[46]={['N']='Sanctum Paravant',['O']=18778,['C']=1.007000,},[15]={['N']='Wenayasel',['O']=18740,},[48]={['N']='Lokjunaam',['O']=18878,['C']=1.037000,['D']='Lokjunaam, sky king serve, is believed to be the ancient throne of a prominent dragon priest from long ago. Atop this site, the nedes built a temple to serve their own sky king, the celestial beings they worship among the stars.',},[82]={['N']='Echo of Moonshadow',['O']=18912,['C']=1.043000,['D']='(Portal hub to other homes, activate FX please!) A fragment of Azura\\'s plane siphoned off and gifted by Sotha Sil as a nexus for his champion to connect doorways to Nirn.',},[85]={['N']='Lorkh\\'s Aspect',['O']=18906,['C']=1.027000,['D']='(Sorry for repost, EHT keeps unlisting it every week or two)\\nThe ashen skies on red mountain make this the perfect hidden sanctum of a powerful vampire experimenting with the essences of Lorkhan eminating from deep within the Red Tower.',},[54]={['N']='The Forgotten Summit',['O']=18501,},[56]={['N']='Ahrkvolen',['O']=18908,['C']=1.043000,['D']='Arkhvolen, the broken hammer, is a well preserved dwarven city created by a clan of dwemer who split from those who would found Volenfell. Recently discovered, this undercity has become the home of some escaping the turmoil above, isolating until the world rests.',},[58]={['N']='Dibellan Chantry',['O']=18738,},[34]={['N']='Dragonguard Hideaway',['O']=18411,},[75]={['N']='Northspire',['O']=18879,['C']=1.017000,['D']='When Orsinium was accepted as a territory of the Empire, the potentates had this Consulate built to service the province. When the last potentate fell and the bretons sacked Orsinium, the consul fled out of fear of retribution for the Empire\\'s inaction. Recently, a minor lord was gifted this land and has restored the castle.',},[9]={['N']='Mathiisen House',['O']=18879,['C']=1.017000,['D']='When Orsinium was accepted as a territory of the Empire, the potentates had this Consulate built to service the province. When the last potentate fell and the bretons sacked Orsinium, the consul fled out of fear of retribution for the Empire\\'s inaction. Recently, a minor lord was gifted this land and has restored the castle.',},[62]={['N']='Remnant of Aldmeris',['O']=18880,['C']=1.020000,['D']='When Artaeum vanished, the Psijics pulled with it pieces of old Aldmeris. Magic pulled from aetherius flows throughout and gives insights to the order as to how their ancestors once lived before departing to Tamriel.',},[42]={['N']='Grand Armiger Suite',['O']=18442,},},['TS']=1634004077,['Key']='oh__@dracenfer',}"
