R["oh__@yumij"]="{['Version']=1754,['eu']={[62]={['D']='Will we change the course of time or will time change us?\\n\\nPlease stay on the balcony and admire the view from there. To travel through time make sure to stand on the carpet on the balcony (you will notice when you\\'re standing on the right spot ;).',['C']=1.018000,['O']=18857,['N']='Climate Change',},[70]={['O']=18840,['N']='Shady Deals',},[10]={['D']='Ah, a customer! Welcome to Murky Potions.\\n\\nAre you looking for a formula to grow back your feathers? Or do you need a solution to take care of a particular \\'problem\\'? \\n\\nMixes-Many-Medicines is happy to provide what you need!\\n\\nYou are welkome to take a look around, but it is advised to not stay too long inside. The air can be.. tricky for those who are not accustomed to it. ',['C']=1.024000,['O']=18857,['N']='Murky Potions',},[11]={['D']='As a backpacker travelling in Europe, I feel at home anywhere. My room is filled with memories of all those places. Every country is different and unique, yet so familiar. Will you take a walk with me through the diversity of Europe?\\n\\nBe sure to take a close look at the pictures on the wall. But don\\'t stay inside only. ;) It looks best during the day when it is not raining.',['C']=1.041000,['O']=18857,['N']='Backpacker\\'s Room',},[4]={['D']='It is a somewhat lonely existance, being the keeper of the clocktower. But time needs to be ticking!\\n\\nPlease come when the stained glass window light is on.',['C']=1.027000,['O']=18857,['N']='the Face of Time',},[5]={['D']='These nomadic tree inhabitants take care of their forest, while travelling very efficient. ;)',['C']=1.031000,['O']=18857,['N']='Nomadic Forest',},[6]={['O']=18504,['N']='Sithis shrine',},[47]={['D']='Wonderland they call it. I wonder..\\nAnd they keep calling me Alice! They must be mad. Or.. am I mad?\\n\\nStay on the path to not get lost and don\\'t forget to look up.\\nIn video settings: put \"View Distance\" at a minimum of 70.',['C']=1.020000,['O']=18857,['N']='We\\'re all mad here',},},['TS']=1629314162,['Key']='oh__@yumij',}"
