R["fx__na__@trasse__36"]="{['TS']=1626267033,['Version']=1742,['Effects']={[1]={['EffectType']=8503,['Id']=1317,['Yaw']=3.946200,['Pitch']=5.511700,['Roll']=0,['Y']=10960,['SizeZ']=50,['Alpha']=1,['Contrast']=1,['MetaData']={['message']='You want my treasure? You can have it! I left everything gathered together in one place. Now you just have to find it...\\n\\nTo start yer treasure-huntin\\' trip,\\nWhy not start aboard me ship?\\nSearch it for another book\\nTo get a clue for where to look.\\n\\n\\n\\n(( This treasure hunt puzzle uses EHT Actions, so it will work even if I\\'m not at home. Please pull the switch by the entrance (either direction works) to reset all the puzzle elements for the next guest before you leave. Thanks! ))',['title']='Captain Garruk\\'s Journal #1',},['SizeX']=46.456460,['SizeY']=50,['X']=89377,['Color']=30037,['Groups']=2.310000,['Z']=67935,},[2]={['EffectType']=1009,['Id']=1318,['Yaw']=0.364800,['Pitch']=0,['Roll']=0,['Y']=11289,['SizeZ']=1,['Alpha']=1,['Contrast']=1,['MetaData']={['is']='On',['when furniture']='4839443319476082969',['will be']='On',['then furniture']='4696690168608876713',},['SizeX']=1,['SizeY']=1,['X']=100848,['Color']=999998,['Groups']=1,['Z']=69695,},[3]={['EffectType']=8503,['Id']=1321,['Yaw']=0.392700,['Pitch']=4.691400,['Roll']=0,['Y']=10631,['SizeZ']=50,['Alpha']=1,['Contrast']=1,['MetaData']={['message']='To find the treasure so ye can gloat,\\nLook off the back side of me boat.\\nGaze out from the starboard stern;\\nThe path to me booty ye shall learn\\nA road of planks and bricks and vine\\nCut \\'cross the wall in a jagged line\\n\\nTo try n\\' jump it would be in vain,\\nSo please allow me to explain:\\nAcross this isle be four devices\\nA wheel, a switch, a blade, n\\' lights...es.\\nWhen each is set in its proper place,\\nA bridge drops down into each space!\\n\\nFour books with clues to set them all,\\nLay within me palatial hall!\\n\\nP.S.  \\n\\nAll 4 puzzle devices can be done in any order, but you\\'